  input: '"TEXT","F3XA","C00167320","Q1. Due to the unanticipated volume of financial
    transactions during the period, the Committee inadvertently failed to disclose
    a portion of its disbursements.  Within a month of filing the original report,
    the Committee audited its report and made the appropriate amendment. The Committee
    intends to adjust its workforce in future elections so that it is better prepared
    to handle the volume of activity to ensure full and timely disclosure of financial
    activity to the FEC.  Q2. In review of  the voter file/consulting issue you reference
    in your letter of May 23, 2005  and in consultation with our legal counsel, we
    have determined that these activities do not meet the definition of Federal Election
    Activity as these expenditures were for costs incurred in the building of our
    voter file.  Q3. The payment for Voter File Software is an administrative cost
    and does meet the definition of Federal Election Activity and was therefore appropriately
    disclosed on line 21 (b)."'
